import React from 'react';
import '../assets/css/InterviewCard2.css'
class InterviewCard2 extends React.Component {

    getStudentsInAcompant=()=>{

    }

    render() {
        const { interview,students } = this.props;
        return (
            <div className="interview-card2">
                <div style={{display:'flex',width:'100%'}}>
                <div className="inter-company ic-2">
                    <span className="smallText">
                        Company
                    </span><br></br>
                    <span className="boldText">
                        {interview.company}
                    </span>
                </div>
                <div className='inter-placed ic-2'>
                    <span className="smallText">
                        Placed/total
                    </span><br></br>
                    <span className="boldText">
                        25/50
                    </span>
                </div>
                <div className="inter-date ic-2">
                    <span className="smallText">
                        Date
                    </span><br></br>
                    <span className="">
                        <b>{interview.date}</b>
                    </span>
                </div>
                </div>

                <div className="student-list-interview" id={"stud-list-" + interview._id}>
                    students appearing for {interview.company}
                    <select id="studentSelect">
                        {students.map((student,id)=>
                            <option>{student.name}</option>
                        )}
                    </select>
                </div>
            </div>
        )
    }
}

export default InterviewCard2;
